import React, { useEffect } from 'react';

import { TypeChooser } from "react-stockcharts/lib/helper";

function Graphh(props) {
    
    useEffect(()=>{
        loopData(props.data.data.hcl);
        console.log(props.data.data.hcl)
    })
    
    const loopData = (hcl) => {
        var array = [];
        var OpenLen = hcl.Open.length;
        
        console.log(OpenLen)
        for( var i = 0; i < OpenLen; i++){
            array.push({ opentime:new Date(props.data.data.hcl.opentime[i]),  open : hcl.Open[i], High: hcl.High[i], Low : hcl.Low[i],closed: hcl.Close[i],Volume : hcl.Volume[i], })
        }
        console.log(array, 'array');
      
    }
    // console.log(new Date(props.data.data.hcl.opentime[0]))

    return (
        <div>
        <TypeChooser>
				{type => <Chart type={type} data={this.state.data} />}
			</TypeChooser>
        </div>
    )
}

export default Graphh
